import React from 'react'
import Post from './../Post/Post'
import {PostsData} from './../Data/PostData'
const Posts = () => {
  return (
    <div className="Posts">
      {PostsData.map((post,id)=>{
        return<Post data={post}/>
      })}
    </div>
  )
}

export default Posts
